import React from "react";
import {
  // BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";

import Navbar from "./NavBar";
import Login from "./login";

import "./App.css";

function App() {
  return (
    // <Router>
    <div className="App">
      <Switch>
        <Navbar />

        <Route path="/login" component={Login} />
      </Switch>
    </div>
    // </Router>
  );
}

export default App;
